var Ac4yLifecycleDimension=require("./Ac4yLifecycleDimension.js");
var Ac4yLifecycleConstant=require("../constant/Ac4yLifecycleConstant.js");  

var Ac4yLCFStation=require("./Ac4yLCFStation.js");

class Ac4yLCDStation extends Ac4yLifecycleDimension {
    
    constructor(object){
        
        super(object);
        if (object != undefined && object === 0) return;
        
        this.setDimension(new Ac4yLifecycleConstant().DIMENSION.station);
        
    } // constructor
    
    createSelf(object) {return new Ac4yLCDStation(object);}
    
} // Ac4yLCDStation

module.exports=Ac4yLCDStation
